import React from 'react';
import back from './Photos/background.png';
import box from './Photos/boxes.png';

import './App.css';

function App() {
  return (
    <div className="App">
      <img src={back} alt="back"/>
      <img src={box} alt="box"/>
    </div>
  );
}

export default App;
